import { useMenu } from "react";

export default function useColumns() {
    const columns = useMemo(
      () => [
        {
          Header: "userId",
          accessor: "userId"
        },
        {
            Header: "id",
            accessor: "id"
          },

        {
          Header: "title",
          accessor: "title"
        },
        {
          Header: "completed",
          accessor: "completed"
        }
     ],
      []
    );

    return columns;
}
